import{_ as e,c as o,o as t,a4 as r}from"./chunks/framework.uQk9_EO2.js";const s="/docs/cocos/assets/home.JJW-dK09.png",n="/docs/cocos/assets/home1.Dbg4gNlr.png",a="/docs/cocos/assets/project.CDmzA_MQ.png",i="/docs/cocos/assets/add-project.-bxwVNep.png",c="/docs/cocos/assets/installs.BM2gVdMM.png",l="/docs/cocos/assets/download.BOyPofoJ.png",p="/docs/cocos/assets/store.BTdSU_pp.png",d="/docs/cocos/assets/community.0fCLMlYk.png",h="/docs/cocos/assets/learn.DGuIUWMG.png",g="/docs/cocos/assets/account.5rFiVxzQ.png",x=JSON.parse('{"title":"Using Cocos Dashboard","description":"","frontmatter":{},"headers":[],"relativePath":"en/getting-started/dashboard/index.md","filePath":"en/getting-started/dashboard/index.md","lastUpdated":1712305443000}'),u={name:"en/getting-started/dashboard/index.md"},m=r('<h1 id="using-cocos-dashboard" tabindex="-1">Using Cocos Dashboard <a class="header-anchor" href="#using-cocos-dashboard" aria-label="Permalink to &quot;Using Cocos Dashboard&quot;">​</a></h1><p>Upon launching the Cocos Dashboard and logging in with your Cocos Developer account, the Dashboard interface opens. Dashboard allows downloading the engine, creating a new project, opening an existing project, or getting help information.</p><p><img src="'+s+'" alt="Dashboard"></p><p>The left navigation menu bar includes: <strong>Home</strong>, <strong>Projects</strong>, <strong>Installs</strong>, <strong>Store</strong>, <strong>Community</strong>, <strong>Learn</strong>, <strong>Settings</strong>, and <strong>Account</strong>. See below for specific instructions.</p><h2 id="home" tabindex="-1">Home <a class="header-anchor" href="#home" aria-label="Permalink to &quot;Home&quot;">​</a></h2><p>The home page contains the Cocos product news, editor version news, and user&#39;s recently opened projects. Here you can quickly open projects, create new projects, install editors, get the latest editor version, etc.</p><p><img src="'+n+'" alt="Dashboard"></p><p>It mainly consists of the following three parts:</p><ul><li>Carousels: shows the latest Cocos product news.</li><li>Recently Projects: Shows recently opened projects, double-click to open a project; the <strong>New Project</strong> button on the top right quickly opens the New Project page to create a project, and the <strong>View More</strong> button takes you to the project list page.</li><li>Editors: Shows released products of Cocos, where you can quickly install editor versions, create new projects, and get the latest released editor versions.</li></ul><h2 id="projects" tabindex="-1">Projects <a class="header-anchor" href="#projects" aria-label="Permalink to &quot;Projects&quot;">​</a></h2><p>The Projects page shows all created/imported projects, <strong>double click</strong> opens the project. The list is empty when you run Cocos Dashboard for the first time, and you can create/import a new project in the top right.</p><p><img src="'+a+'" alt="Dashboard"></p><ul><li><strong>1</strong>: Search for projects directly by project name.</li><li><strong>2</strong>: Sorts projects in forward/reverse order according to the most recent open time.</li><li><strong>3</strong>: Select another version of the editor that has been successfully installed to open the project.</li><li><strong>4</strong>: Operation menu, which can also be opened by right-clicking. Support <strong>Open (project)</strong>, <strong>Show in Finder/Explorer</strong>, <strong>Remove from list</strong>, <strong>Select the icon of the project</strong>, <strong>Rename the project</strong>, <strong>Set the description of the project</strong>: <ul><li><strong>Select the icon of the project</strong>: Customize the project cover image, currently supports four formats: BMP, PNG, GIF and JPG.</li><li><strong>Rename the project</strong>: Renaming the project name will also rename the project folder.</li><li><strong>Set the description of project</strong>: Can be used to note descriptive information related to the project.</li></ul></li></ul><h3 id="new-project" tabindex="-1">New Project <a class="header-anchor" href="#new-project" aria-label="Permalink to &quot;New Project&quot;">​</a></h3><p>Creator provides a number of project templates, including basic architectures for different types of games, as well as sample resources and scripts for learning to help developers get into creative work faster. As Cocos Creator becomes more complete, we will continue to add more project templates.</p><p>Click <strong>Templates</strong> and <strong>Examples</strong> in the upper left to switch the project type. <strong>Editor Version</strong> is used to select the editor version for creating the project, and the drop-down box includes all successfully installed versions.</p><p><img src="'+i+'" alt="Dashboard"></p><p>Check any of the project templates and at the bottom of the page you can see <strong>Project Name</strong> and <strong>Location</strong>:</p><ul><li><strong>Name</strong>: The project name can only contain <strong>a-z</strong>, <strong>A-Z</strong>, <strong>0-9</strong> as well as <strong>_</strong> and <strong>-</strong>.</li><li><strong>Location</strong>: Click the icon behind the Project Path input box to select the project&#39;s storage path, or you can manually enter it in the input box.</li></ul><p>Once everything is set up, click the <strong>Create and Open</strong> button to finish creating the project; the Dashboard window will be hidden and the newly created project will open in the main Cocos Creator editor window.</p><h2 id="installs" tabindex="-1">Installs <a class="header-anchor" href="#installs" aria-label="Permalink to &quot;Installs&quot;">​</a></h2><p>The Installs page displays the successfully installed product editor, and you can import/install the editor version by clicking the button on the top right.</p><p><img src="'+c+'" alt="Dashboard"></p><blockquote><p><strong>Note</strong>: When Cocos Dashboard is first run, this list is empty. Click the two buttons in the top right corner to import existing Creator editors locally or download and install them directly.</p></blockquote><ul><li><p><strong>Locate</strong>: Used to add locally existing editors, supports dragging and dropping locally existing Creator editors directly from the operating system&#39;s file manager into the version list.</p></li><li><p><strong>Install Editor</strong>: Clicking on this button opens the Install Editor page, showing all installed and uninstalled versions of the editor, which can be downloaded and installed as needed.</p><p><img src="'+l+'" alt="Download"></p></li></ul><h2 id="store" tabindex="-1">Store <a class="header-anchor" href="#store" aria-label="Permalink to &quot;Store&quot;">​</a></h2><p>Cocos game development resource center, you can browse, download and install official or third-party extensions, source code, resources and so on, specific instructions can refer to the <a href="https://store.cocos.com/document/en/" target="_blank" rel="noreferrer">Cocos Store</a>.</p><p><img src="'+p+'" alt="store"></p><h2 id="community" tabindex="-1">Community <a class="header-anchor" href="#community" aria-label="Permalink to &quot;Community&quot;">​</a></h2><p>This tab is used to post official announcements or events of Cocos Creator, including the <strong>News</strong> and <strong>Update</strong> modules.</p><p><img src="'+d+'" alt="community"></p><h2 id="learn" tabindex="-1">Learn <a class="header-anchor" href="#learn" aria-label="Permalink to &quot;Learn&quot;">​</a></h2><p>The Learn page collects official tutorial resources from Cocos, as well as editor&#39;s choice and forum Pinned Topics.</p><p><img src="'+h+'" alt="learn"></p><h2 id="account" tabindex="-1">Account <a class="header-anchor" href="#account" aria-label="Permalink to &quot;Account&quot;">​</a></h2><p>Displays information about the currently logged in account, the ability to go to the account center, and logging out.</p><p><img src="'+g+'" alt="account"></p><p>Developers can also visit the official Cocos website for tutorials and other information by clicking the icon below:</p><ul><li><a href="https://twitter.com/CocosEngine" target="_blank" rel="noreferrer">Twitter</a></li><li><a href="https://www.facebook.com/CocosEngine" target="_blank" rel="noreferrer">Facebook</a></li><li><a href="https://discuss.cocos2d-x.org/c/33" target="_blank" rel="noreferrer">Forum</a></li><li><a href="https://discord.com/invite/pVqab4K" target="_blank" rel="noreferrer">Discord</a></li><li><a href="https://www.youtube.com/cocosengine" target="_blank" rel="noreferrer">YouTube</a></li><li><a href="https://github.com/cocos/cocos-engine" target="_blank" rel="noreferrer">GitHub</a></li></ul>',39),f=[m];function b(w,_,y,j,C,k){return t(),o("div",null,f)}const v=e(u,[["render",b]]);export{x as __pageData,v as default};
